bmuskalla.vscode-tldr: "{\"tldrfetcher.cache.install\":\"# install\\n\\n> Copy
  files and set attributes.\\n> Copy files (often executable) to a system
  location like `/usr/local/bin`, give them the appropriate
  permissions/ownership.\\n> More information:
  <https://www.gnu.org/software/coreutils/install>.\\n\\n- Copy files to
  destination:\\n\\n`install {{path/to/source}} {{path/to/destination}}`\\n\\n-
  Copy files to destination, setting their ownership:\\n\\n`install -o {{user}}
  {{path/to/source}} {{path/to/destination}}`\\n\\n- Copy files to destination,
  setting their group ownership:\\n\\n`install -g {{user}} {{path/to/source}}
  {{path/to/destination}}`\\n\\n- Copy files to destination, setting their
  `mode`:\\n\\n`install -m {{+x}} {{path/to/source}}
  {{path/to/destination}}`\\n\\n- Copy files and apply access/modification times
  of source to destination:\\n\\n`install -p {{path/to/source}}
  {{path/to/destination}}`\\n\",\"tldrfetcher.cache.set\":\"# set\\n\\n> Display
  or set environment variables for the current instance of CMD.\\n> More
  information:
  <https://docs.microsoft.com/windows-server/administration/windows-commands/se\
  t>.\\n\\n- List all current environment variables:\\n\\n`set`\\n\\n- Set an
  environment variable to a specific value:\\n\\n`set {{name}}={{value}}`\\n\\n-
  List environment variables starting with the specified string:\\n\\n`set
  {{name}}`\\n\\n- Prompt the user for a value for the specified
  variable:\\n\\n`set /p
  {{name}}={{prompt_string}}`\\n\",\"tldrfetcher.cache.echo\":\"# echo\\n\\n>
  Print given arguments.\\n> More information:
  <https://www.gnu.org/software/coreutils/echo>.\\n\\n- Print a text message.
  Note: quotes are optional:\\n\\n`echo \\\"{{Hello World}}\\\"`\\n\\n- Print a
  message with environment variables:\\n\\n`echo \\\"{{My path is
  $PATH}}\\\"`\\n\\n- Print a message without the trailing newline:\\n\\n`echo
  -n \\\"{{Hello World}}\\\"`\\n\\n- Append a message to the file:\\n\\n`echo
  \\\"{{Hello World}}\\\" >> {{file.txt}}`\\n\\n- Enable interpretation of
  backslash escapes (special characters):\\n\\n`echo -e \\\"{{Column
  1\\\\tColumn 2}}\\\"`\\n\",\"tldrfetcher.cache.apt\":\"# apt\\n\\n> Package
  management utility for Debian based distributions.\\n> Recommended replacement
  for apt-get when used interactively in Ubuntu versions 16.04 and later.\\n>
  More information: <https://manpages.debian.org/latest/apt/apt.8.html>.\\n\\n-
  Update the list of available packages and versions (it's recommended to run
  this before other `apt` commands):\\n\\n`sudo apt update`\\n\\n- Search for a
  given package:\\n\\n`apt search {{package}}`\\n\\n- Show information for a
  package:\\n\\n`apt show {{package}}`\\n\\n- Install a package, or update it to
  the latest available version:\\n\\n`sudo apt install {{package}}`\\n\\n-
  Remove a package (using `purge` instead also removes its configuration
  files):\\n\\n`sudo apt remove {{package}}`\\n\\n- Upgrade all installed
  packages to their newest available versions:\\n\\n`sudo apt upgrade`\\n\\n-
  List all packages:\\n\\n`apt list`\\n\\n- List installed packages:\\n\\n`apt
  list --installed`\\n\",\"tldrfetcher.cache.mkdir\":\"# mkdir\\n\\n> Creates a
  directory.\\n> More information:
  <https://docs.microsoft.com/windows-server/administration/windows-commands/mk\
  dir>.\\n\\n- Create a directory:\\n\\n`mkdir {{directory_name}}`\\n\\n-
  Recursively create a nested directory tree:\\n\\n`mkdir
  {{path/to/sub_directory_name}}`\\n\",\"tldrfetcher.cache.git\":\"# git\\n\\n>
  Distributed version control system.\\n> More information:
  <https://git-scm.com/>.\\n\\n- Check the Git version:\\n\\n`git
  --version`\\n\\n- Show general help:\\n\\n`git --help`\\n\\n- Show help on a
  Git subcommand (like `commit`, `log`, etc.):\\n\\n`git help
  {{subcommand}}`\\n\\n- Execute a Git subcommand:\\n\\n`git
  {{subcommand}}`\\n\\n- Execute a Git subcommand on a custom repository root
  path:\\n\\n`git -C {{path/to/repo}} {{subcommand}}`\\n\\n- Execute a Git
  subcommand with a given configuration set:\\n\\n`git -c
  '{{config.key}}={{value}}' {{subcommand}}`\\n\",\"tldrfetcher.cache.npm\":\"#
  npm\\n\\n> JavaScript and Node.js package manager.\\n> Manage Node.js projects
  and their module dependencies.\\n> More information:
  <https://www.npmjs.com/>.\\n\\n- Interactively create a `package.json`
  file:\\n\\n`npm init`\\n\\n- Download all the packages listed as dependencies
  in package.json:\\n\\n`npm install`\\n\\n- Download a specific version of a
  package and add it to the list of dependencies in `package.json`:\\n\\n`npm
  install {{module_name}}@{{version}}`\\n\\n- Download a package and add it to
  the list of dev dependencies in `package.json`:\\n\\n`npm install
  {{module_name}} --save-dev`\\n\\n- Download a package and install it
  globally:\\n\\n`npm install --global {{module_name}}`\\n\\n- Uninstall a
  package and remove it from the list of dependencies in
  `package.json`:\\n\\n`npm uninstall {{module_name}}`\\n\\n- Print a tree of
  locally-installed dependencies:\\n\\n`npm list`\\n\\n- List top-level globally
  installed modules:\\n\\n`npm list --global
  --depth={{0}}`\\n\",\"tldrfetcher.cache.host\":\"# host\\n\\n> Lookup Domain
  Name Server.\\n\\n- Lookup A, AAAA, and MX records of a domain:\\n\\n`host
  {{domain}}`\\n\\n- Lookup a field (CNAME, TXT,...) of a domain:\\n\\n`host -t
  {{field}} {{domain}}`\\n\\n- Reverse lookup an IP:\\n\\n`host
  {{ip_address}}`\\n\\n- Specify an alternate DNS server to query:\\n\\n`host
  {{domain}} {{8.8.8.8}}`\\n\",\"tldrfetcher.cache.env\":\"# env\\n\\n> Show the
  environment or run a program in a modified environment.\\n> More information:
  <https://www.gnu.org/software/coreutils/env>.\\n\\n- Show the
  environment:\\n\\n`env`\\n\\n- Run a program. Often used in scripts after the
  shebang (#!) for looking up the path to the program:\\n\\n`env
  {{program}}`\\n\\n- Clear the environment and run a program:\\n\\n`env -i
  {{program}}`\\n\\n- Remove variable from the environment and run a
  program:\\n\\n`env -u {{variable}} {{program}}`\\n\\n- Set a variable and run
  a program:\\n\\n`env {{variable}}={{value}} {{program}}`\\n\\n- Set multiple
  variables and run a program:\\n\\n`env {{variable1}}={{value}}
  {{variable2}}={{value}} {{variable3}}={{value}}
  {{program}}`\\n\",\"tldrfetcher.cache.port\":\"# port\\n\\n> Package manager
  for macOS.\\n\\n- Search for a package:\\n\\n`port search
  {{search_term}}`\\n\\n- Install a package:\\n\\n`sudo port install
  {{package_name}}`\\n\\n- List installed packages:\\n\\n`port installed`\\n\\n-
  Update port and fetch latest list of available packages:\\n\\n`sudo port
  selfupdate`\\n\\n- Upgrade outdated packages:\\n\\n`sudo port upgrade
  outdated`\\n\\n- Remove old versions of installed packages:\\n\\n`sudo port
  uninstall inactive`\\n\",\"tldrfetcher.cache.false\":\"# false\\n\\n> Returns
  an exit code of 1.\\n> More information:
  <https://www.gnu.org/software/coreutils/false>.\\n\\n- Return an exit code of
  1:\\n\\n`false`\\n\",\"tldrfetcher.cache.n\":\"# n\\n\\n> Tool to manage
  multiple node versions.\\n\\n- Install a given version of node. If the version
  is already installed, it will be activated:\\n\\n`n {{version}}`\\n\\n-
  Display installed versions and interactively activate one of
  them:\\n\\n`n`\\n\\n- Remove a version:\\n\\n`n rm {{version}}`\\n\\n- Execute
  a file with a given version:\\n\\n`n use {{version}} {{file.js}}`\\n\\n-
  Output binary path for a version:\\n\\n`n bin
  {{version}}`\\n\",\"tldrfetcher.cache.ifconfig\":\"# ifconfig\\n\\n> Network
  Interface Configurator.\\n> More information:
  <https://net-tools.sourceforge.io/man/ifconfig.8.html>.\\n\\n- View network
  settings of an ethernet adapter:\\n\\n`ifconfig eth0`\\n\\n- Display details
  of all interfaces, including disabled interfaces:\\n\\n`ifconfig -a`\\n\\n-
  Disable eth0 interface:\\n\\n`ifconfig eth0 down`\\n\\n- Enable eth0
  interface:\\n\\n`ifconfig eth0 up`\\n\\n- Assign IP address to eth0
  interface:\\n\\n`ifconfig eth0 {{ip_address}}`\\n\"}"
